<div class="entities" style="line-height: 2.5; direction: ltr">Genetic determinants of diabetes are similarly associated with other immune-mediated diseases . PURPOSE OF REVIEW : I discuss the increasing number of genes discovered to exert pleiotropic action on susceptibility to diabetes and simultaneously to other immune-mediated diseases . While a genetic correlation between type 1 diabetes and autoimmunity is not surprising , the mechanism of a relationship to other conditions such as atopy is less obvious . The recent wave of genome-wide association studies offers confirmation of previously recognized risk loci , but also novel loci that also are likely to act via multiple pathogenetic pathways . I will review this material more in a genetical than an immunological way . RECENT FINDINGS : Identification of Q9BYX4 , an RNA helicase involved in the innate immune response to viral infection as a risk factor for type 1 diabetes and rheumatoid arthritis . Confirmation of the roles of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 as general immune function modulators with a nonlinear dose-response effect on autoimmunity , and confirmation of the role of

<div class="entities" style="line-height: 2.5; direction: ltr">Vitamin D analogues . The plethora of actions attributed to 1,25 ( OH ) 2D3 throughout the body have suggested potential therapeutic applications for the treatment of hyperproliferative diseases , immune dysfunction , endocrine disorders , and metabolic bone disease . However , the potent calcemic activity of the natural vitamin D hormone has precluded its use in most cases . New vitamin D analogues are under development that display greater specificity , in most cases , by retaining the therapeutic properties of 1,25 ( OH ) 2D3 , but with lower calcemic activity . Two analogues have been approved for use in patients : calcipotriol ( DB02300 from Leo Pharmaceuticals , Copenhagen , Denmark ) for the treatment of psoriasis ; and 19 - nor -1,25 ( OH ) 2D2 ( 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 from Abbott Laboratories , Abbott Park , IL ) for secondary hyperparathyroidism . Many others analogues are currently being tested in preclinical and clinical trials for the treatment of various types of cancer and osteoporosis , and for immunosuppression . The selectivity of the analogues can be attributed to the combined interactions with four proteins : the vitamin D receptor ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ) , the serum vitamin D binding protein ( DBP ) , the vitamin D - 24 - hydroxylase and to a newly described membrane receptor . Low DBP affinity has been shown to be responsible for the reduced calcemic actions of calcipotriol and 22 - oxacalcitriol ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ) , which is being tested for secondary hyperparathyroidism . However , the low calcemic activity of other analogues , including 19 - nor -1,25 ( OH ) 2D2 , involves other , as yet undefined , mechanisms . Understanding of the molecular basis for the selectivity of the vitamin D analogues will allow the design of more effective and safer vitamin D compounds for the treatment of a wide range of clinical disorders .</div>

<h2 style="margin: 0">19</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">UMD ( Universal mutation database ) : a generic software to build and analyze locus-specific databases . The human genome is thought to contain about 80,000 genes and presently only 3,000 are known to be implicated in genetic diseases . In the near future , the entire sequence of the human genome will be available and the development of new methods for point mutation detection will lead to a huge increase in the identification of genes and their mutations associated with genetic diseases as well as cancers , which is growing in frequency in industrial states . The collection of these mutations will be critical for researchers and clinicians to establish genotype / phenotype correlations . Other fields such as molecular epidemiology will also be developed using these new data . Consequently , the future lies not in simple repositories of locus-specific mutations but in dynamic databases linked to various computerized tools for their analysis and that can be directly queried on-line . To meet this goal , we devised a generic software called UMD ( Universal Mutation Database ) . It was developed as a generic software to create locus-specific databases ( LSDBs ) with the 4 ( th ) Dimension ( R ) package from ACI . This software includes an optimized structure to assist and secure data entry and to allow the input of various clinical data . Thanks to the flexible structure of the UMD software , it has been successfully adapted to nine genes either involved in cancer (
